import {Link} from 'react-router-dom'
const Navbar =(props)=>{
    return(
        <div className='flex justify-between bb b--white-10'>
            <h1>AmazingWeatherApp</h1>
            <div>
                <Link to='/'>Home</Link>
                <Link to='/favorites'>Favorites</Link>
            </div>
        </div>
    )
}

export default Navbar
